import React from 'react'
import {
    Dialog,
} from '@material-ui/core'
import EnhancedTable from '../../Layout/EnhancedTable'

export default function VariableCostsDialog(props) {
    return (
        <div>
            <Dialog
                open={props.open}
                onClose={props.onClose}
            >
                <EnhancedTable title={'Variable Costs'}/>
            </Dialog>
        </div>
    )
}
